const CHANGE_DATE = 'CHANGE_DATE';

const initialState = {
    today : new Date ()

}

export default function dateReducer(state=initialState, action){

    switch (action.type) {
        case CHANGE_DATE:
            return state;

        default:
            return state;
    }
}
